import React, { useState } from 'react';
import Navbar from '../components/Navbar';
import './NasaLibrary.css';

function NasaLibrary() {
  const [searchTerm, setSearchTerm] = useState('Earth');
  const [images, setImages] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const searchImages = async () => {
    setLoading(true);
    try {
      const response = await fetch(`/api/nasa-library?q=${searchTerm}`);
      const data = await response.json();
      if (data.length > 0) {
        setImages(data);
      } else {
        setImages([]);
      }
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="nasa-library-container">
      <Navbar />

      <h1>NASA Image and Video Library</h1>
      <input
        type="text"
        placeholder="Search for images..."
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
      />
      <button onClick={searchImages}>Search</button>

      {loading && <p>Loading...</p>}
      {error && <p>Error: {error}</p>}
      {images.length === 0 && !loading && <p>No results found.</p>}

      <div className="image-grid">
        {images.map((image, index) => (
          <div key={index} className="image-item">
            <img src={image.links[0].href} alt={image.data[0].title} />
            <p>{image.data[0].title}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default NasaLibrary;
